import { createSlice } from "@reduxjs/toolkit";
import { loginExtraReducer } from "../extraReducers/authExtraReducer";

const initialState =  {
    data: [],
    status: "idle",
    error: null,
  }
const geoSlice = createSlice({
    name: 'geo',
    initialState,
    reducers: {},
    extraReducers: 
      {
        ...loginExtraReducer


      }
  });

  export default geoSlice.reducer;
